    false,nt"url": null,nt"notes": "This wetlands report for Upper Souris National
    Wildlife Refuge outlines Refuge accomplishments during the 1969 calendar year. The
    report begins by summarizing the weather conditions, water conditions, and food
    and cover conditions during the year. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, and raptors- is also
    covered. The Refuge development and maintenance section discusses physical developments,
    plantings, collections and receipts, vegetation control, and wildfires. A progress
    report on field investigations and applied research is also provided. N-R forms
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
